/*Table structure for table `t_ubah_ari` */

DROP TABLE IF EXISTS `t_ubah_ari`;

CREATE TABLE `t_ubah_ari` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `id_spta` int(10) DEFAULT NULL,
  `no_spta` varchar(20) DEFAULT NULL,
  `no_ba` varchar(100) DEFAULT NULL,
  `persen_brix_ari` double(4,2) DEFAULT NULL,
  `persen_pol_ari` double(4,2) DEFAULT NULL,
  `r_persen_brix_ari` double(4,2) DEFAULT NULL,
  `r_persen_pol_ari` double(4,2) DEFAULT NULL,
  `user_create` varchar(100) DEFAULT NULL,
  `tgl_create` datetime DEFAULT NULL,
  `user_approve` varchar(100) DEFAULT NULL,
  `tgl_approve` datetime DEFAULT NULL,
  `status` smallint(1) DEFAULT NULL,
  `alasan` varbinary(200) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1;

/*Table structure for table `t_ubah_selektor` */

DROP TABLE IF EXISTS `t_ubah_selektor`;

CREATE TABLE `t_ubah_selektor` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `no_ba` varchar(50) DEFAULT NULL,
  `id_spta` int(10) DEFAULT NULL,
  `no_spta` varchar(20) DEFAULT NULL,
  `persno_mandor` varchar(20) DEFAULT NULL,
  `brix_sel` double(4,2) DEFAULT NULL,
  `ph_sel` double(4,2) DEFAULT NULL,
  `ditolak_sel` smallint(1) DEFAULT NULL,
  `r_perno_mandor` varchar(20) DEFAULT NULL,
  `r_brix_sel` double(4,2) DEFAULT NULL,
  `r_ph_sel` double(4,2) DEFAULT NULL,
  `r_ditolak_sel` smallint(1) DEFAULT NULL,
  `alasan` varchar(200) DEFAULT NULL,
  `status` smallint(1) DEFAULT NULL,
  `user_create` varchar(100) DEFAULT NULL,
  `tgl_create` datetime DEFAULT NULL,
  `user_approve` varchar(100) DEFAULT NULL,
  `tgl_approve` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

/*Table structure for table `t_ubah_spta` */

DROP TABLE IF EXISTS `t_ubah_spta`;

CREATE TABLE `t_ubah_spta` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `no_ba` varchar(50) DEFAULT NULL,
  `id_spta` int(10) DEFAULT NULL,
  `no_spta` varchar(20) DEFAULT NULL,
  `tebang_pg` smallint(1) DEFAULT NULL,
  `angkut_pg` smallint(1) DEFAULT NULL,
  `vendor` int(10) DEFAULT NULL,
  `rubah_tebang_pg` smallint(1) DEFAULT NULL,
  `tubah_angkut_pg` smallint(1) DEFAULT NULL,
  `rubah_vendor` int(10) DEFAULT NULL,
  `status` smallint(1) DEFAULT NULL COMMENT '1. buat 2. validasi',
  `tgl_create` datetime DEFAULT NULL,
  `user_create` varchar(20) DEFAULT NULL,
  `tgl_approve` datetime DEFAULT NULL,
  `user_approve` varchar(20) DEFAULT NULL,
  `alasan` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;



